<html>
<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1">
<style type="text/css">
            body {
                margin: 0;
                padding: 0;
                min-width: 100vw;
                overflow: hidden;
                min-height: 100vh;
                position: relative;
            }

            .container {
                display: flex;
                align-items: center;
                flex-direction: column;

                top: 50%;
                left: 50%;
                position: absolute;
                transform: translate(-50%, -50%);

                text-align: center;
                text-transform: uppercase;
                font-family: 'Roboto', sans-serif;
            }

            .caption {
                font-size: 1.25rem;
                margin-top: 2rem;
                color: #0e0e0e;
            }

            .blazing {
                font-size: .85rem;
                margin-top: .35rem;
            }

            .neko {
                width: 10rem;
                height: 10rem;
                border-radius: 50%;
                animation: neko 1700ms cubic-bezier(.8, 0, .2, 1) infinite;
            }

            @keyframes neko {
                from {
                    transform: rotate(0deg);
                }
                to {
                    transform: rotate(360deg);
                }
            }
        </style>
    <script> 
	function click() { 
	if (event.button==2||event.button==3) { 
	oncontextmenu='return false'; 
	} 
	} 
	document.onmousedown=click 
	document.oncontextmenu = new Function("return false;") 
	</script>
    <script> 
	document.onkeydown = function(e) { 
	if (e.ctrlKey && (e.keyCode === 67 || e.keyCode === 86 || e.keyCode === 85 || e.keyCode === 117)) {
	} 
	return false; 
	}; 
	</script>
	<script>
	function disableWheelScroll(){
	if (document.body.addEventListener) document.body.addEventListener('DOMMouseScroll', blockWheel, false);
	document.body.onmousewheel = blockWheel;
	}
	function blockWheel(event){
	if (!event) event = window.event;
	if (event.stopPropagation) event.stopPropagation();
	else event.cancelBubble = true;
	if(event.preventDefault) event.preventDefault();
	else event.returnValue = false;
	}
	disableWheelScroll();
	</script>
